import React, {Component} from 'react';
import ImageList from "./ImageList";
import Alphabet from "./Alphabet";

class HomeEnglish extends Component {
    constructor(props) {
        super(props);
        this.state = {
            colors: ["cam", "den", "do", "hong", "nau", "tim", "vang", "xanhd", "xanhl", "xam"],
            color: ""

        }
    }

    componentDidMount() {
        const cunrrentColor = this.state.colors.find(color => color === this.props.match.params.color);
        if (cunrrentColor) {
            this.setState({color: cunrrentColor
            })
        }
    }

    render() {
        return (
            <div>
                <div>
                    <h1 className="game-title">Play-Game</h1>
                </div>
                <div>
                    <h1 className="win" style={{display: 'none', marginTop: 350}}>WIN</h1>
                </div>
                <ImageList
                    url={this.state.color.url}
                    code={this.state.color.code}
                />
                <Alphabet
                    url={this.state.color.url}
                    code={this.state.color.code}
                />
            </div>
        );
    }
}

export default HomeEnglish;
